import "../styles/QA";
const QA = () => {
  return (
    <div>
      <section style={{ display: "flex", justifyContent: "flex-end" }}>
        <input
          type="text"
          placeholder="問題搜尋"
          style={{ padding: "5px", marginRight: "1rem" }}
        />
        <button
          style={{ padding: "5px", borderRadius: "5px", marginRight: "1rem" }}
        >
          <i class="fa-solid fa-magnifying-glass"></i>
        </button>
      </section>
      <section className="QABlock">
        <div></div>
      </section>
    </div>
  );
};

export default QA;
